Aki Hoshino (Japanese Idol) Photo Collection

Born 14th March 1977, is one of Japan&amp;#039;s oldest bikini idols. She has appeared in various men&amp;#039;s magazines, such as Sabra, and often appears on Japanese television shows as a guest. One of her nicknames is &quot;Angel of Japan.&quot;

NB. All Images are a Min&amp;#039; size of 1100 x 1500, Not my sort of thing but someone might like &amp;#039;em.
